jQuery(document).ready(function(){if(!_.isUndefined(kirkiIcons.section)){_.each(kirkiIcons.section,function(b,a){jQuery("#accordion-section-"+a+" > h3").addClass("dashicons-before "+b);jQuery("#sub-accordion-section-"+a+" .customize-section-title > h3").append('<span class="dashicons '+b+'" style="float:left;padding-right:.1em;padding-top:2px;"></span>')})}if(!_.isUndefined(kirkiIcons.panel)){_.each(kirkiIcons.panel,function(b,a){jQuery("#accordion-panel-"+a+" > h3, #sub-accordion-panel-"+a+" .panel-title").addClass("dashicons-before "+b)})}});